#######################################################################
# Layered structure represented as interfaces.                        # 
# Interface is a contact surface between two media.                   # 
# The model is given by the interface axis and the medium parameters  #
# above and below it along with a vertical linear variation constrain.#
# The interface is ordered from the free surface to depth.            # 
# The free surface is taken as an interface between air and the first #
# layer. The medium below the last interface is an half space.        # 
#######################################################################

#-- the following two parameters specify the medium type and in which
#-- components it was given. The valid value is
#--   anisotropy_type := ISO VTI TTI TRICLINIC
#--     ISO: isotropic medium
#--     VTI: vertical transv
#--   stiffness_type  := velocity tensor

anisotropy_type = ISO
stiffness_type = velocity

#-- the total number of interface including the free surface --
number_of_interface = 12

#######################################################################
#                           media parameters                          #
#######################################################################

#-- Medium parameters for each interface, two rows per interface:
#-- values above (+ sign) and below (- sign) the interface.
#-- the meaning of each column for ISO --
#-- rho      Vp      Vs     -- 
#-- the meaning of each column for VTI --
#-- rho     Vpv      Vsv    Vph    Vsh   eta -- 
